import React from 'react';
import { Navbar, Nav, NavDropdown } from 'react-bootstrap';
import { DropdownMenu, MenuItem } from 'react-bootstrap-dropdown-menu'

// import './styles.css';
import profileIcon from '../Images/profileIcon.png';
import shoppingCartIcon from '../Images/shoppingCart.png';
import shoppingIconIcon from '../Images/shoppingIcon.png';
// import aboutMePage from '../Pages/AboutMe/AboutMe'

class NavBar extends React.Component {
    render () {
        return (
            <Navbar bg="light" expand="lg" sticky='top'>
                <Navbar.Brand href="#home">Kreative Zings</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="mr-auto">
                        <Nav.Link href="./HomePage">Home</Nav.Link>
                        <Nav.Link href="./AboutMe">AboutMe</Nav.Link>
                        <Nav.Link href="./Stickers">Stickers</Nav.Link>
                        <Nav.Link href="./CustomOrder">Custom Order</Nav.Link>
                        <Nav.Link href="./ContactMe">Contact me</Nav.Link>
                        <NavDropdown title="Profile" id="basic-nav-dropdown"><img src={profileIcon}></img>
                            <NavDropdown.Item href="#action/3.1">Login</NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.2">Create Account</NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.3">View Profile</NavDropdown.Item>
                            <NavDropdown.Divider />
                            <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                        </NavDropdown>

                        <Nav.Link href="#home">Cart</Nav.Link>
                        <Nav.Link href="#home">Checkout</Nav.Link>
                        {/* <Nav.Link href="#home">Profile</Nav.Link> */}
                    </Nav>
                    {/* <Form inline>
                        <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                        <Button variant="outline-success">Search</Button>
                    </Form> */}
                </Navbar.Collapse>
                {/* <Styles /> */}
            </Navbar> 
        )
    }
}

export default NavBar;
